To customize the chainspec for your parachain network, you'll need to edit the following fields in the chainspec.plain.json file: Set name, id, and protocolId to unique values: {
"name": "UniqueParachainName",
"id": "unique-parachain-id",
"protocolId": "unique-protocol-id",
...
} Set relay_chain to rococo: {
"relay_chain": "rococo",
...
} Set chainType to Live: {
"chainType": "Live",
...
} Set your ParaID in both para_id and genesis.runtimeGenesis.patch.parachainInfo.parachainId: { "para_id": <your-parachain-id>, "genesis": { "runtime": { "runtimeGenesis": { "patch": { "parachainInfo": { "parachainId": <your-parachain-id> } } } }
},
...
} Set sudo.key to your desired sudo account: { "genesis": { "runtime": { "sudo": { "key": "<your-sudo-account>" } } }, ...
} You will also need specific customization relevant to your nodes: Set bootNodes addresses, any node which has a public IP or DNS can be a bootnode: { "bootNodes": [ # eg. IP bootnode "/ip4/<Node-Public-IP>/tcp/30333/p2p/<Node-ID>" # eg. DNS bootnode "/dns/<Node-Public-DNS>/tcp/30333/p2p/<Node-ID>", # (Optional) WSS Bootnodes (for light clients, requires a TLS cert, see https://wiki.polkadot.network/docs/maintain-bootnode) "/dns/<Node-Public-DNS>/tcp/443/wss/p2p/<Node-ID>",
...
} Set your genesis collator keys: { "collatorSelection": { "candidacyBond": 16000000000, # For non-invulnerables collators "invulnerables": [ "5GrwvaEF5zXb26Fz9rcQpDWS57CtERHpNehXCPcNoHGKutQY", # Collator 1 Address "5FHneW46xGXgs5mUiveU4sbTyGBzmstUspZC92UhjJM694ty" # Collator 2 Address ] }, ... "session": { "keys": [ [ "5GrwvaEF5zXb26Fz9rcQpDWS57CtERHpNehXCPcNoHGKutQY", # Collator Address "5GrwvaEF5zXb26Fz9rcQpDWS57CtERHpNehXCPcNoHGKutQY", # Collator Controller Address (for legacy controller/stash separation, just set this to the same as above) { "aura": "5GrwvaEF5zXb26Fz9rcQpDWS57CtERHpNehXCPcNoHGKutQY" # Collator aura public key } ], [ ... ] ]
},

